import React from 'react';
import List from '../List/List';
import data from '../../data/data.json';

const CountryList: React.FC = () => {
    return <ul>
        {data.map((props) => (
            <List>{props.name} | {props.currency}</List>
        ))}
    </ul>
};

export default CountryList;
